import "./Layout//wineDisplay.css";

export default function wineDisplay() {
  return (
      <div>
        <img src="https://d27jswm5an3efw.cloudfront.net/app/uploads/2019/07/insert-image-html.jpg" alt="HTML code." width="800" height="533" class="img-fluid img-center img-round img-featured" data-v-0f11a864=""/>
      <h1>{wineOne.name}</h1>
      <p class="price">${wineOne.price}</p>
      <li>
        <ul>Type: {wineOne.type}</ul>
        <ul>Region: {wineOne.region}</ul>
      </li>
      <p>
        <button>More Information</button>
      </p>
    </div>
  );
}
